import React from "react";

import "./styles/global.css";
import "./styles/pages/landing-page.css";

function App() {
  return (
    <div className="App">
      <div id="landing-page">
        <div className="content-wrapper">
          <main>
            <strong>Igreja Presbiteriana do Recreio</strong>
            <span>Agende sua visita</span>
          </main>
          <button>Culto</button>
          <button>Jovens</button>
        </div>
      </div>
    </div>
  );
}

export default App;
